import React from "react";
import renderGraph from "./Graph";
import "./Dashboard.css";

function Dashboard() {
  return (
    <>
      <h1 className="centerText">Dashboard</h1>
      <div className="incExpenses">
        Income and Expenses
        <renderLineChart>{renderGraph}</renderLineChart>
      </div>
      <div className="savings">savings</div>
      <div className="spent">spent</div>
      <div className="displayIncExpenses">inc expenses</div>
    </>
  );
}

export default Dashboard;
